\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Civil Literature</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"853\">&lt;p&gt;Nach dem release ihres neuen Albums 2014, verbrachte Civil Literature mehr als ein Jahr damit, auf den großen Bühnen der riesigen Hallen in Großbritanien, ihre Leidenschaft für die Rock Musik zu teilen - und 2015 dann sogar weltweit. In dieser Zeit wuchs die Rockband noch enger zusammen und schrieb ihr drittes Album.&lt;/p&gt;&lt;p&gt;Im Jahr 2010 gründete Liam, der Frontsänger der Band Civil Literature die Band mit seinem Bruder Garry, der in Manchester auch als Gitarrist und Songschreiber bekannt ist. Im Jahr 2011 folgte dann Marc. Sein Talent als Bass Spieler ergänzt sich perfekt zu der Musik die sie machten. Zusammen hatten sie einen großen Traum. Sie wollen zusammen die Bühne der Royal Albert Halle rocken. Im Jahr 2016 stehen sie vor diesem Ziel nun so kurz bevor. Vorallem deshalb, weil ihr neues Album Rekorde in ganz Europa bricht.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">quote</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-quote#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"178\">Ich war schon immer ein leidenschaftlicher Song Schreiber. Mein größter Wunsch ist es die Menschen zu berühren und mit meiner Botschaft ermutigen nach ihren Träumen zu leben.</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-quoteReference#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Liam Hendrickson</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">albums</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-settings#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-albums#2\" sv:type=\"Long\" sv:multi-valued=\"1\"><sv:value length=\"1\">1</sv:value><sv:value length=\"1\">2</sv:value><sv:value length=\"1\">3</sv:value><sv:value length=\"1\">4</sv:value></sv:property><sv:property sv:name=\"i18n:de-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">default</sv:value></sv:property><sv:property sv:name=\"i18n:de-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:de-published\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.158+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:de-authored\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.143+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:de-author\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:de-created\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.519+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:de-changed\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.519+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:de-navContexts\" sv:type=\"String\" sv:multi-valued=\"1\"/><sv:property sv:name=\"i18n:de-nodeType\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property></sv:node>\n', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<sv:node xmlns:mix=\"http://www.jcp.org/jcr