name=\"i18n:en-url\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">/artists/coyoos</sv:value></sv:property><sv:property sv:name=\"i18n:en-headerImage\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">{\"id\":21}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">4</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Coyoos</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"290\">&lt;p&gt;After releasing their record album in 2012, Coyoos spent more than one year bringing their passion for the folk music to the big concerthalls and arenas all over the United States – in 2015 worldwide. In this time the folkband started to grow together and wrote there second album.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">quote</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quote#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"171\">Travelling and singing is all I need. Discover new places and meeting inspiring people are the experiences you never forget. It is my source of creativity and inspiration.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quoteReference#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">Jack</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"290\">&lt;p&gt;In 2014 Jack started his music career in San Diego, California. His talent in playing the guitar made him famous in a short period of time. His one big dream: touring around the United States. In 2016 he is as close as never before – with his new album, reaching records in the US.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">albums</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-albums#3\" sv:type=\"Long\" sv:multi-valued=\"1\"><sv:value length=\"1\">5</sv:value><sv:value length=\"1\">6</sv:value><sv:value length=\"1\">7</sv:value><sv:value length=\"1\">8</sv:value></sv:property><sv:property sv:name=\"i18n:en-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">default</sv:value></sv:property><sv:property sv:name=\"i18n:en-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:en-authored\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.192+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-author\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-created\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.192+00:00</sv:value></sv:property><sv:property sv:na