perty><sv:property sv:name=\"i18n:en-url\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"22\">/artists/marshall-plan</sv:value></sv:property><sv:property sv:name=\"i18n:en-headerImage\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"8\">{\"id\":4}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">4</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Marshall Plan</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"287\">&lt;p&gt;Releasing their record album in 2003, Marshall Plan spent more than one year bringing their passion for the rock music to the big concerthalls and arenas all over Great Britain – in 2015 worldwide. In this time the rockband started to grow together and wrote there second album.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">quote</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quote#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"174\">We love making music together and to inspire people around us with our songs. We come from a small town in the UK. It still feels unreal, to be known from Asia to the States.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quoteReference#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Jason Mcconkey</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"460\">&lt;p&gt;In 2003 Alex, the frontman of Marshall Plan founded the band with his best friends Bronson, Albert and Ray. Those well known guitar player and songwriter in Liverpool. In 2007 Jason followed. His talent in playing the bass fullfilled the intense music vibes. Together they had one big dream: rocking the stage in front of the Times Square in New York. In 2016 they are as close as never before. With their new album, reaching records all over the world.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">albums</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-albums#3\" sv:type=\"Long\" sv:multi-valued=\"1\"><sv:value length=\"1\">9</sv:value><sv:value length=\"2\">10</sv:value><sv:value length=\"2\">11</sv:value><sv:value length=\"2\">12</sv:value></sv:property><sv:property sv:name=\"i18n:en-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">default</sv:value></sv:property><sv:property sv:name=\"i18n:en-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:en-authored\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.238+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-author\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv