ue></sv:property><sv:property sv:name=\"i18n:de-blocks-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">The Bagpipes</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"560\">&lt;p&gt;In den Anfängen haben sich die Bagpipes auf traditionelle und zeitnahe Musik mit ihrem innovativen Flair konzentriert, bevor sie sich dann auf ihre klassische Dudelsackmusik stürtzten. Kurz nach der Veröffentlichung ihres Albums in 1998, haben die Bagpipes mehr als ein Jahr zusammen damit verbracht, ihre Leidenschaft auf die Bühnen und Arenen Schottlands zu bringen - in 2015 dann Weltweit. In dieser Zeit wuchs die Folkband noch enger zusammen und schrieb ihr viertes Album. Sie wurden die Schottische Folkband von den Jahren 2003, 2005 und 2014.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">quote</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-quote#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Unsere Karriere startete auf den Straßen von Glasgow. Es gibt nichts authentischeres als Straßenmusik. Die Menschen mögen dich, oder laufen einfach weiter. Man merkt sofort, wie die Musik ankommt.</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-quoteReference#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">Steve Avril</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">albums</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-settings#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:de-blocks-albums#2\" sv:type=\"L