d – in 2015 worldwide. In this time the folkband started to grow together and wrote there fourth album. Soon they become the Scottish folkband of the year 2003, 2005 and 2014.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">quote</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quote#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"195\">We started our career in the streets of Glasgow. There is nothing more real and authentic then playing street music. People like you, or they don\'t and pass you. You immediately get the reaction.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-quoteReference#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">Steve Avril</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">albums</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-albums#2\" sv:type=\"Long\" sv:multi-valued=\"1\"><sv:value length=\"2\">13</sv:value><sv:value length=\"2\">14</sv:value><sv:value length=\"2\">15</sv:value><sv:value length=\"2\">16</sv:value></sv:property><sv:property sv:name=\"i18n:en-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">default</sv:value></sv:property><sv:property sv:name=\"i18n:en-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:en-published\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-03-08T14:11:30.309+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-authored\" sv:type=\"Date\" 