y><sv:property sv:name=\"i18n:uk-blocks-settings#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"3\">dev</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:ru-headerImage\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-type#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">connected</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-settings#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-icon_two#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">icon-playcircle</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-icon_one#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"19\">play_circle_outline</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-icon_one#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"19\">play_circle_outline</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-icon_two#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">icon-playcircle</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-imageLogo#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">{\"id\":41}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-videos#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">{\"ids\":[36]}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Design Thinking</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"29\">Дизайн Мислення</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"430\">Допомагаємо виводити на ринок новий продукт. У короткий термін придумуємо ідеї і висуваємо теорії. Перевіряємо теорії на простих варіантах реалізації і разом розуміємо, як можна стратегічно працювати з вашою аудиторією та продуктом. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Digital Strategy / Діджитал Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-typo_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"165\">Оцінюємо ефективність, необхідні ресурси і витрати. Готуємо ваших співробітників до змін.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Tech Strategy / Технічна Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-typo_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"339\">Формуємо Back Log - розподіл завдання по блокам. З ним буде легше зрозуміти структуру, витрати, проектування і плани завантаження команди. Прописуємо ітерації і спринти роботи над проектом.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_sensor_sm#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"25\">New sensor. New insights.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-typo_sensor_sm#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">The new blood oxygen sensor is made up of four LED clusters and four photodiodes. Incorporated into the completely redesigned back crystal, this new sensor works in concert with the Blood Oxygen app to determine your blood oxygen level.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_leds_sm#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">Deeply illuminating.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-typo_leds_sm#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"245\">Green, red, and infrared LEDs shine light onto the blood vessels in your wrist, and photodiodes measure the amount of light reflected back. Advanced algorithms then calculate the color of your blood, which indicates the amount of oxygen present.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"44\">Creative &lt;br class=\"large\"&gt;Digital Marketing</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Креативний Маркетинг в &lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"406\">Підходимо до маркетингу в діджіталі з іншого боку. Розробляємо креативну комунікаційну стратегію: побудова лід-магнітів, вірусні стратегії і провокації, випуск супутніх продуктів. Робимо ваш бренд &lt;span class=\"raidbow-txt\"&gt;Original&lt;/span&gt;.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fingertip_title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"49\">Digital Entrance / Вихід в Діджитал</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fingertip_desc#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"476\">Допомагаємо вашому бізнесу правильно вийти в онлайн. Підійде, якщо у вас сильний офлайн, але ви ніяк не представлені в діджітале. Ми допоможемо прорахувати всі вигоди моделі Діджитал, скільки потрібно витрат і як це може може окупитися і вплинути на ваш бізнес.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Digital Branding</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"75\">Брендинг&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; в Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Digital Branding</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"75\">Брендинг&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; в Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Display</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Always on.&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; Better than ever</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Now warming up.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">text</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-finishes_caption#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">Text</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">Text</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"139\">Crafted from a soft, stretchable silicone rubber, the Solo Loop is ultracomfortable, lightweight, and surprisingly easy to slip on and off.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Braided Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"156\">Silicone threads are interwoven with over 16,000 recycled polyester yarn filaments to create a band that’s as textural and stretchable as it is beautiful.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Дизайн-&lt;br class=\"small\"&gt;процес</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">UI / UX</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Дизайн-&lt;br class=\"small\"&gt;процес</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">UI / UX</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"388\">Проводимо повний аудит вашого проекту. Аналізуємо шлях користувача і його взаємодію з вами. Проводимо інтерв\'ю і вивчаємо, як люди користуються вашим продуктом. Знаходимо слабкі місця і допомагаємо їх поліпшити.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">There’s a face for that.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"226\">Now you can easily discover and share custom faces for whoever you are and whatever you’re into — with all the information that matters most all in one place. Find your favorites on the App Store, the web, or social media.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Design Thinking</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"29\">Дизайн Мислення</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"242\">We help bring a new product to market. In a short time we come up with ideas and put forward theories. We test theories on simple implementation options and together we understand how you can work strategically with your audience and product.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Digital Strategy / Діджитал Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-typo_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"96\">We evaluate the efficiency, necessary resources and costs. We prepare your employees for change.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Tech Strategy / Технічна Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-typo_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"212\">We form Back Log - distribution of the task on blocks. It will make it easier to understand the structure, costs, design and plans for loading the team. We prescribe iterations and sprints of work on the project.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"44\">Creative &lt;br class=\"large\"&gt;Digital Marketing</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Креативний Маркетинг в &lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"248\">We approach digital marketing from the other side. We develop a creative communication strategy: building ice magnets, viral strategies and provocations, the release of related products. We make your brand &lt;span class=\"raidbow-txt\"&gt;Original&lt;/span&gt;.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fingertip_title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"49\">Digital Entrance / Вихід в Діджитал</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fingertip_desc#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"256\">We help your business to go online properly. Suitable if you have a strong offline, but you are not represented in digital. We will help you calculate all the benefits of the Digital model, how much it costs and how it can pay off and affect your business.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Digital Branding</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"75\">Брендинг&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; в Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"222\">We create the face of your brand in digital. We think through communication and create a dynamic identity that will speak about you the same everywhere - in your presentations, advertising, social networks and on the site.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Digital Branding.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Брендинг в Діджіталі.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Дизайнерські послуги</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Виклик відчуттів та вражень</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Music, Podcasts, and Audiobooks.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"84\">Listen to whatever motivates you to move. Including 70 million songs on Apple Music.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-rings_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Activity Rings.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-rings_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"76\">Stay motivated to sit less, move more, and get some exercise. Day after day.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sharing_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Activity Sharing.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sharing_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"74\">Share your Activity rings with friends and family to encourage each other.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-competitions_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Competitions.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-competitions_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"60\">Invite friends to compete in a seven-day Activity challenge.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-caption#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fitness_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Now warming up.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fitness_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-link_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"228\">Застосовуючи креативність та амбіції, наша студія реалізовує ваші ідеї завдяки ретельно продуманим рішенням на замовлення.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-finishes_caption#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">Solo Loop</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"22\">Slip on something new.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"197\">An innovative new seamless band joins the Apple Watch Series 6 lineup, without a clasp or buckle in sight. Available in two materials and nine custom sizes, tailored to the size of your&amp;nbsp;wrist.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-solo_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-solo_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"139\">Crafted from a soft, stretchable silicone rubber, the Solo Loop is ultracomfortable, lightweight, and surprisingly easy to slip on and off.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Braided Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"156\">Silicone threads are interwoven with over 16,000 recycled polyester yarn filaments to create a band that’s as textural and stretchable as it is beautiful.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"29\">Продуктивність.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"61\">Бездоганно збалансовані рішення.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1012\">Наш спектр послуг з ефективного маркетингу зосереджений на зростанні, дохідності та частки ринку.\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Хмарні сервіси&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Відмовостійкі та масштабовані хмарні рішення, що надаються через (AWS; OVH; Google Cloud Platform).&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Оптимізація PageSpeed&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Покращуйте взаємодію з користувачем, збільшуйте трафік та допомагайте збільшити кількість конверсій.&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Design&lt;br class=\"small\"&gt;Process</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">UI / UX</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">There’s a face for that.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"226\">Now you can easily discover and share custom faces for whoever you are and whatever you’re into — with all the information that matters most all in one place. Find your favorites on the App Store, the web, or social media.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Design Thinking.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle_oxygen#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Дизайн Мислення.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"430\">Допомагаємо виводити на ринок новий продукт. У короткий термін придумуємо ідеї і висуваємо теорії. Перевіряємо теорії на простих варіантах реалізації і разом розуміємо, як можна стратегічно працювати з вашою аудиторією та продуктом. </sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Digital Strategy / Діджитал Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-typo_sensor#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"165\">Оцінюємо ефективність, необхідні ресурси і витрати. Готуємо ваших співробітників до змін.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Tech Strategy / Технічна Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-typo_leds#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"339\">Формуємо Back Log - розподіл завдання по блокам. З ним буде легше зрозуміти структуру, витрати, проектування і плани завантаження команди. Прописуємо ітерації і спринти роботи над проектом.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\">Creative Digital Marketing.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"100\">Креативний Маркетинг в &lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; Діджіталі.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"380\">Підходимо до маркетингу в діджіталі з іншого боку. Розробляємо креативну комунікаційну стратегію: побудова лід-магнітів, вірусні стратегії і провокації, випуск супутніх продуктів. Робимо ваш бренд &lt;b&gt;Original&lt;/b&gt;.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fingertip_title#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"49\">Digital Entrance / Вихід в Діджитал</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fingertip_desc#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"476\">Допомагаємо вашому бізнесу правильно вийти в онлайн. Підійде, якщо у вас сильний офлайн, але ви ніяк не представлені в діджітале. Ми допоможемо прорахувати всі вигоди моделі Діджитал, скільки потрібно витрат і як це може може окупитися і вплинути на ваш бізнес.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">UX Audit.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">UX Аудит.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"387\">Проводимо повний аудит вашого проекту. Аналізуємо шлях користувача і його взаємодію з вами. Проводимо інтерв\'ю і вивчаємо як люди користуються вашим продуктом. Знаходимо слабкі місця і допомагаємо їх поліпшити.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Digital Branding.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Брендинг в Діджіталі.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-workouts_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-workouts_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-altimeter_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-altimeter_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Дизайнерські послуги</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Виклик відчуттів та вражень</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-audio_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Music, Podcasts, and Audiobooks.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-audio_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"84\">Listen to whatever motivates you to move. Including 70 million songs on Apple Music.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-rings_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Activity Rings.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-rings_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"76\">Stay motivated to sit less, move more, and get some exercise. Day after day.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-sharing_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Activity Sharing.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-sharing_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"74\">Share your Activity rings with friends and family to encourage each other.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-competitions_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Competitions.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-competitions_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"60\">Invite friends to compete in a seven-day Activity challenge.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-caption#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fitness_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Now warming up.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fitness_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-link_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-text_fitness#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Розробка</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"125\">Реалізуєм&lt;br class=\"small\"&gt; ваші ідеї завдяки&lt;br class=\"small\"&gt; продуманим рішенням</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"228\">Застосовуючи креативність та амбіції, наша студія реалізовує ваші ідеї завдяки ретельно продуманим рішенням на замовлення.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-finishes_caption#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">Solo Loop</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"22\">Slip on something new.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"197\">An innovative new seamless band joins the Apple Watch Series 6 lineup, without a clasp or buckle in sight. Available in two materials and nine custom sizes, tailored to the size of your&amp;nbsp;wrist.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-solo_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-solo_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"139\">Crafted from a soft, stretchable silicone rubber, the Solo Loop is ultracomfortable, lightweight, and surprisingly easy to slip on and off.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-braided_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Braided Solo Loop.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-braided_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"156\">Silicone threads are interwoven with over 16,000 recycled polyester yarn filaments to create a band that’s as textural and stretchable as it is beautiful.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"29\">Продуктивність.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"61\">Бездоганно збалансовані рішення.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1012\">Наш спектр послуг з ефективного маркетингу зосереджений на зростанні, дохідності та частки ринку.\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Хмарні сервіси&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Відмовостійкі та масштабовані хмарні рішення, що надаються через (AWS; OVH; Google Cloud Platform).&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Оптимізація PageSpeed&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Покращуйте взаємодію з користувачем, збільшуйте трафік та допомагайте збільшити кількість конверсій.&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Motion graphics.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">Графіка руху.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-custom_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">There’s a face for that.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-custom_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"226\">Now you can easily discover and share custom faces for whoever you are and whatever you’re into — with all the information that matters most all in one place. Find your favorites on the App Store, the web, or social media.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-excerpt-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Netexy Studio</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">products_grid</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-images#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">{\"displayOption\":null,\"ids\":[40,34]}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-faces_title_1#10\" sv:type=\"String\" sv:multi-valued=\"0\"><s