t;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-image_nested#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-type#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-settings#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 6</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-description#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">&lt;p&gt;Subtitle 6&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-image_nested#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Web &amp; App&lt;br class=\"large\"&gt; Development</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"76\">Розробка веб-сайтів&lt;br class=\"large\"&gt; та додатків</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"116\">Applying creativity and ambition, our studio realizes your ideas thanks to carefully thought-out decisions to order.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">SEO.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"178\">Чіткі, перевірені та зрозумілі стратегії SEO, що сприяють досягненню важливих для вас результатів.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Контент.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"142\">Станьте авторитетом у пошукових системах з тем, які цікавлять ваших клієнтів.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Електронна пошта.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"133\">Зверніть увагу на найбільш зацікавлену аудиторію, відповідно націливши.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">PPC та дисплей.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"143\">Наші спеціальні кампанії створені для того, щоб стимулювати найважливіші дії.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fifth_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Соц.медіа</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fifth_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"144\">Збільшуємо охоплення бренду та залучаємо нових клієнтів у соціальних мережах.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sixth_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sixth_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"107\">Розробляємо прямолінійну стратегію цифрового маркетингу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">products_grid</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_line_#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Created with Snap</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_area_#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">more</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:ru-excerpt-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Netexy Studio</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-workouts_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-workouts_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-altimeter_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-altimeter_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Розробка</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"125\">Реалізуєм&lt;br class=\"small\"&gt; ваші ідеї завдяки&lt;br class=\"small\"&gt; продуманим рішенням</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-audio_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-audio_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-rings_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-rings_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-sharing_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-sharing_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-competitions_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-competitions_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-first_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-first_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-second_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-second_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-third_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-third_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fourth_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fourth_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-caption#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fitness_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Now warming up.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-fitness_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-link_fitness#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-text_fitness#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-finishes_caption#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-solo_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-solo_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-braided_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-braided_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Display</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"65\">Always on.&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; Better than ever.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"227\">The Always-On Retina display is now significantly brighter outdoors when your wrist is down. So you can see all the information on your watch face more easily than ever — without having to raise your wrist to wake your watch.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-alwayson_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Digital Studio</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subtitle#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Netexy</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-description#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"404\">Неодноразово доведено, що наша суміш креативного, технічного та маркетингового маркетингу, а також одержимість забезпеченням якості збільшує дохід та частку ринку.\n&lt;br&gt;&lt;sup&gt;— Ми просто називаємо це &lt;b&gt;«Увага до digital ™»&lt;/b&gt;.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-custom_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-custom_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblocks#12-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblocks#12-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblocks#12-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblocks#12-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblocks#12-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 1&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:ru-blocks-subblock