-valued=\"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"28\">Продуктивність</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"60\">Бездоганно збалансовані рішення</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1014\">Наш спектр послуг з ефективного маркетингу зосереджений на зростанні, дохідності та частки ринку.\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Хмарні сервіси&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Відмовостійкі та масштабовані хмарні рішення, що надаються через (AWS; OVH; Google Cloud Platform).&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Оптимізація PageSpeed&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Покращуємо взаємодію з користувачами, збільшуємо трафік та допомагаємо збільшити кількість конверсій.&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-finishes_caption#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"25\">Назва слайду 1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"45\">&lt;p&gt;Короткий опис слайду&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-sliderImageSmall#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-sliderImageMedium#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-sliderImageLarge#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv: