er personas, key use cases, current pain points, business goals, industry best practices.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_two#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"147\">&lt;b&gt;2. UI/UX audit&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Equity analysis, areas of opportunity, takeaway synthesis, WCAG 2.0 accessibility check, competitive analysis.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_three#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (UI Kit based on atomic design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#6\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#7\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_one#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"150\">&lt;b&gt;1. Discovery&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Requirements gathering: user personas, key use cases, current pain points, business goals, industry best practices.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_two#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"147\">&lt;b&gt;2. UI/UX audit&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Equity analysis, areas of opportunity, takeaway synthesis, WCAG 2.0 accessibility check, competitive analysis.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_three#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (based on design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fifth_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Соц.медіа</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fifth_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"144\">Збільшуємо охоплення бренду та залучаємо нових клієнтів у соціальних мережах.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sixth_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sixth_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"107\">Розробляємо прямолінійну стратегію цифрового маркетингу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-finishes_caption#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Tit