erty sv:name=\"i18n:uk-blocks-subblocks#20-image_nested#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">fitness_plus</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_line_#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Created with Snap</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_area_#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">faces</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Digital Studio</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Netexy</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Корпоративний веб-сайт</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#14\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені дл