olean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#2\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\">We create a brand identity.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"306\">&lt;ul class=\"copy-block-copy typography-copy-block\"&gt;\n    &lt;li class=\"icon-branding\"&gt;Branding&lt;/li&gt;\n    &lt;li class=\"icon-art-direction\"&gt;Art Direction&lt;/li&gt;\n    &lt;li class=\"icon-logo-design\"&gt;Logo Design&lt;/li&gt;\n    &lt;li class=\"icon-iconography\"&gt;Iconography&lt;/li&gt;\n    &lt;li class=\"icon-illustration\"&gt;Illustration&lt;/li&gt;\n&lt;/ul&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#3\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_1#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description_1#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"234\">Let\'s help to find all bugs and shortcomings in a product before its start. Let\'s make the full list of tasks and options of their decisions. We find vulnerabilities, errors, incorrect request processing. We make your product cleaner.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_2#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description_2#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"240\">We build a development team for your project from scratch. We decide on your technology stack and build a team of quality specialists under it. Can we assemble both a permanent and a temporary team, which may be needed to start the project.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title_3#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description_3#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"282\">In a short time we run simple solutions to test hypotheses and theories of bringing your product to market. We run an advertising campaign and a test product, analyze reviews, clicks and metrics. Based on them, we draw conclusions that will help in launching a full-fledged project.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-images_available#4\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-gradient_available#4\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_trigger#5\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_params#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"98\">All design ideas that we implement are based on the best user experience with ensuring the result.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">We are artists and we love when everything looks great, but great design also sells, teaches, communicates and succeeds.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_tx