d=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#23\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">family_setup</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#23\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_line_#23\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Created with Snap</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_area_#23\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#23\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">motivation</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Розробка</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"125\">Реалізуєм&lt;br class=\"small\"&gt; ваші ідеї завдяки&lt;br class=\"small\"&gt; продуманим рішенням</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_title#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Корпоративний веб-сайт</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_desc#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-rings_title#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-rings_desc#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sharing_title#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sharing_desc#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-competitions_title#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-competitions_desc#24\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#24\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-page_one#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">92609e3a-023c-42df-8dbb-5d29f6c01ef9</sv:value></sv:property><sv:property sv:name=\"i18n:uk-excerpt-more\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"93\">Netexy Studio - розробка сайтів та додатків на замовлення</sv:value></sv:property><sv:property sv:name=\"i18n:en-excerpt-more\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"62\">Netexy Studio - development of sites and applications to order</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Brand Guideline</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"296\">Міцна, креативна та стратегічна основа для вашого бренду. Розробка та впровадження принципів фірмового стилю для всіх ваших маркетингових матеріалів та каналів</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">Logo Design</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"354\">Професійний та ідентичний дизайн логотипу, що створить сильний публічний імідж для вашого бізнесу. Включає найкращі концепції графічного дизайну логотипу для елегантного стилю вашого бренду.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-create_style_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Netexy Studio</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-create_style_msg#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">Будь-який продукт,&lt;br /&gt; бренд та стиль.&lt;br /&gt; Все, що захочете.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-create_style_link#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">1f23315e-71bd-451c-8c8a-8c02c0018634</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-create_style_text#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">Створіть свій стиль</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Brand Guideline</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"158\">A strong, creative and strategic foundation for your brand. Develop and implement corporate identity principles for all your marketing materials and channels.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">Logo Design</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"180\">Professional and identical logo design that will create a strong public image for your business. Includes the best graphic logo design concepts for the elegant style of your brand.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-create_style_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Netexy Studio</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-create_style_msg#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"49\">Any product. Any brand.&lt;br /&gt; Any style you want.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-create_style_link#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">1f23315e-71bd-451c-8c8a-8c02c0018634</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-create_style_text#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Create your style</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">Web (PWA)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"308\">Швидкий веб-сайт з гнучкими налаштуваннями стилів для бізнесу. Зручний інтерфейс панелі керування та розширені можливості системи для динамічної публікації контенту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">eCommerce</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Ефективна та мультифункціональна платформа для електронної комерції, надає неперевершений рівень гнучкості та пропонує безліч можливостей для чіткого налаштування відповідно до вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_three_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">Native App (Flutter)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_three_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"380\">Додаток з виразним і гнучким UI, нативною продуктивністю та плавною анімацією, характерною для кожної  ОС.  Заощадить 40% бюджету та до 50% економії часу розробки, завдяки коду, що пишеться один раз і працює всюди.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_four_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Multi-Platform</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_four_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"479\">Мультидоменна веб-платформа з функціями Headless та Content Management System вмістом, з інструментами для гнучкого макетування сторінок. Високопродуктивна, багатофункціональна, розроблена для компаній, що швидко розвиваються, з тухнічними можливостями масштабувати бізнес.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_five_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\"> Multi-Vendor (Marketplace)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_five_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"416\">Багатофункціональна платформа зі зручною панеллю керування, високопродуктивна з потужними маркетинг-системою та ефективними інструментами. Розроблена та оптимізована для великих бізнес-проектів з розширеними можливостями.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">Web (PWA)</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"155\">Fast website with flexible style settings for business. Convenient control panel interface and advanced system capabilities for dynamic content publishing.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">eCommerce</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"144\">An efficient and versatile e-commerce platform, it provides unmatched flexibility and offers many options for fine-tuning to suit your business.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_three_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">Native App (Flutter)</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_three_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"226\">An application with a clear and flexible UI, native performance and smooth animation, specific to each OS. It will save 40% of the budget and up to 50% of development time because the code is written once and works everywhere.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_four_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Multi-Platform</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_four_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"261\">Multi-Site Platform with Headless capabilities and the features of a full content management system, with tools for flexible page layout . Highly productive, multifunctional, designed for fast-growing companies with technical capabilities to scale the business.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_five_title#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\"> Multi-Vendor (Marketplace)</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_five_desc#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"207\">Multifunctional platform with a convenient control panel, high-performance with a powerful marketing system and effective tools. Designed and optimized for large business projects with advanced capabilities.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Digital Marketing</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"35\">Цифровий маркетинг</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"92\">Our range of effective marketing services focuses on growth, profitability and market share.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"3\">SEO</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_one_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"88\">Clear, proven and understandable SEO strategies that help you achieve important results.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Content</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_two_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"77\">Become an authority in search engines on topics that interest your customers.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_three_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">Email</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_three_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"69\">Pay attention to the most interested audience, targeting accordingly.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_four_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">PPC&amp;Display</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-block_four_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Our special campaigns are designed to stimulate critical action.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"3\">SEO</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_one_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"178\">Чіткі, перевірені та зрозумілі стратегії SEO, що сприяють досягненню важливих для вас результатів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Контент</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_two_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"142\">Станьте авторитетом у пошукових системах з тем, які цікавлять ваших клієнтів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_three_title#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Електронна пошта</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-block_three_desc#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"133\">Зверніть увагу на найбільш за