ативний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_title#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_desc#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"227\">The Always-On Retina display is now significantly brighter outdoors when your wrist is down. So you can see all the information on your watch face more easily than ever — without having to raise your wrist to wake your watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Design Services</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\">Дизайн-послуги</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Now warming up.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-finishes_caption#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"8\">UX Audit</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">UX Аудит</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"388\">Проводимо повний аудит вашого проекту. Аналізуємо шлях користувача і його взаємодію з вами. Проводимо інтерв\'ю і вивчаємо, як люди користуються вашим продуктом. Знаходимо слабкі місця і допомагаємо їх поліпшити.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 1&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-image_nested#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">{\"displayOption\":null,\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-title#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 2</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-description#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 2&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-image_nested#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">{\"displayOption\":null,\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-type#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#11-settings