sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#12-image_nested#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Web &amp; App&lt;br class=\"large\"&gt; Development</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"76\">Розробка веб-сайтів&lt;br class=\"large\"&gt; та додатків</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"228\">Застосовуючи креативність та амбіції, наша студія реалізовує ваші ідеї завдяки ретельно продуманим рішенням на замовлення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_title#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_desc#13\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_line_#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Created with Snap</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_area_#14\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">more</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-excerpt-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">Netexy Studio</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_title#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_desc#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Design Services</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\">Дизайн-послуги</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-audio_desc#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-rings_title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n: