"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-solo_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"8\">UX Audit</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">UX Аудит</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"203\">We conduct a full audit of your project. We analyze the user\'s path and his interaction with you. We conduct interviews and learn how people use your product. We find weaknesses and help to improve them.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Always-on access.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Swipe down for Notification Center, swipe up for Control Center, or tap complications in the wrist‑down state. No need to wake your watch for simple interactions when you’re in a meeting or otherwise occupied.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Motion Graphics</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"23\">Графіка руху</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"162\">Creation of effective and informative video content, banners, animation elements, pages. Our works attract attention, entertain and perfectly cope with the tasks.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 1&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#12-image_nested#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value