s#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">connected</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_1#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_1#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_2#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_2#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_3#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_3#5\" sv:type=\"String\" 