lue length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-image_nested#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-image_nested#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#17-image_nested#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">{\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_line_#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Created with Snap</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_area_#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Digital Marketing</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"35\">Цифровий маркетинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Корпоративний веб-сайт</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageSmall#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageMedium#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageLarge#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageSmall#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageMedium#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#15-sliderImageLarge#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"