bblocks#15-sliderImageLarge#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Now warming up</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"228\">Застосовуючи креативність та амбіції, наша студія реалізовує ваші ідеї завдяки ретельно продуманим рішенням на замовлення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#18-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#18-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#18-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#18-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1<