pe=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-competitions_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_one#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"150\">&lt;b&gt;1. Discovery&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Requirements gathering: user personas, key use cases, current pain points, business goals, industry best practices.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_two#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"147\">&lt;b&gt;2. UI/UX audit&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Equity analysis, areas of opportunity, takeaway synthesis, WCAG 2.0 accessibility check, competitive analysis.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_three#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (based on design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_1#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_1#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_2#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_2#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_3#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_3#8\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#10\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_one#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"276\">&lt;b&gt;1. Discovery&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Збір вимог: персональні дані користувачів, ключові випадки використання, поточні проблеми, ділові цілі, найкращі практики в галузі.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_two#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"245\">&lt;b&gt;2. UI/UX аудит&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Аналіз власного капіталу, сфери можливостей, синтез на винос, перевірка доступності WCAG 2.0, конкурентний аналіз.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_three#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"200\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Інформаційна архітектура, UX-карта, low-fidelity wireframes, проєкт прототипу, який можна клікати.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"474\">&lt;b&gt;4. Візуальна концепція та застосування стилю&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Візуальний напрямок, mood-boards, концепція інтерфейсу ключових екранів. Застосування візуальної концепції, затвердженої на попередньому етапі, до решти екранів. Високоякісний прототип, який можна клікати.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion дослідження поведінки інтерфейсу, iconography та ілюстрації.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"441\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Постійна бібліотека елементів інтерфейсу користувача (на основі принципів системи дизайну), рекомендації для команди розробників, iconography, ілюстративні вказівки та інші елементи ідентичності бренду, коли це потрібно.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_title#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_desc#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#15\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Now warming up</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#20\" sv:type=\