alued=\"0\"><sv:value length=\"382\">Сайти, які відрізняються неповторним дизайном і продуманим функціоналом. Які вирішують бізнес-завдання і виводять бренд на новий рівень сприйняття. І звичайно, сайти, які отримують статусні світові нагороди.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-type#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">faces</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-settings#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Digital Studio</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Netexy</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Корпоративний веб-сайт</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-audio_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-rings_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sharing_desc#22\" sv:type=\"String\