erty><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageSmall#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":182}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageMedium#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":176}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageLarge#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":166}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageSmall#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":183}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageMedium#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":171}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageLarge#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":165}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageSmall#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":179}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageMedium#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":170}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageLarge#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":163}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#11\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_one#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"150\">&lt;b&gt;1. Discovery&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Requirements gathering: user personas, key use cases, current pain points, business goals, industry best practices.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_two#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"147\">&lt;b&gt;2. UI/UX audit&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Equity analysis, areas of opportunity, takeaway synthesis, WCAG 2.0 accessibility check, competitive analysis.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_three#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#11\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (based on design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"26\">Пост-продакшн.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-solo_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"347\">Тут відбувається справжня магія - поєднання ключових повідомлень із зображеннями бренду, відеоматеріалами та завершальними штрихами, завдяки яким ваш вміст виділяється поміж конкурентів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Вогні, камера, екшен!.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-braided_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"229\">Створюємо весь наш контент власноруч , зберігаючи максимальну гнучкість контролю, коли йдеться про всю важливу пост-обробку.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageSmall#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":147}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageMedium#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":144}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#10-sliderImageLarge#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":146}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"56\">Cтворюємо ідентичність бренду.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"306\">&lt;ul class=\"copy-block-copy typography-copy-block\"&gt;\n    &lt;li class=\"icon-branding\"&gt;Branding&lt;/li&gt;\n    &lt;li class=\"icon-art-direction\"&gt;Art Direction&lt;/li&gt;\n    &lt;li class=\"icon-logo-design\"&gt;Logo Design&lt;/li&gt;\n    &lt;li class=\"icon-iconography\"&gt;Iconography&lt;/li&gt;\n    &lt;li class=\"icon-illustration\"&gt;Illustration&lt;/li&gt;\n&lt;/ul&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_1#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_1#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_2#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_2#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_3#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_3#4\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#5\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_1#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_1#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_2#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_2#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title_3#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description_3#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-class#7\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">designe</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-images_available#4\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-images_available#7\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-gradient_available#4\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-gradient_available#7\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_trigger#16\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-theme_params#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-finishes_caption#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"322\">Ми пропонуємо стратегії цифрового маркетингу, які призводять до результатів. Працюючи на повному діапазоні цифрових каналів, ми залучатимемо вашу аудиторію, де б вона не була.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Now warming up</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-title#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Digital Studio</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subtitle#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Netexy</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"404\">Неодноразово доведено, що наша суміш креативного, технічного та маркетингового маркетингу, а також одержимість забезпеченням якості збільшує дохід та частку ринку.\n&lt;br&gt;&lt;sup&gt;— Ми просто називаємо це &lt;b&gt;«Увага до digital ™»&lt;/b&gt;.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 1&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-image_nested#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">{\"displayOption\":null,\"id\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-type#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-settings#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-title#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 2</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#21-description#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:v