gth=\"220\">Ми художники і любимо, коли все виглядає чудово, але чудовий дизайн також продає, навчає, спілкується та досягає успіхів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageSmall#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":181}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageMedium#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":174}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageLarge#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":167}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageSmall#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":177}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageMedium#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":173}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageLarge#1\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":169}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageSmall#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":180}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageMedium#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":172}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageLarge#2\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":168}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageSmall#3\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":182}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageMedium#3\" sv:type=\"String\" sv:multi-valued=\"