valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_four#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_five#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-list_six#9\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (based on design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-raidbow_txt#9\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-type#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-settings#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">UI Design</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-description#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">&lt;p&gt;Crypto&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageSmall#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":178}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageMedium#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":175}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#8-sliderImageLarge#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":164}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-type#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-settings#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">UI Design</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-description#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">&lt;p&gt;Crypto&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageSmall#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":178}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageMedium#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":175}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#9-sliderImageLarge#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":164}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">SEO.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-first_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"178\">Чіткі, перевірені та зрозумілі стратегії SEO, що сприяють досягненню важливих для вас результатів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Контент.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-second_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"142\">Станьте авторитетом у пошукових системах з тем, які цікавлять ваших клієнтів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Електронна пошта.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-third_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"133\">Зверніть увагу на найбільш зацікавлену аудиторію, відповідно націливши.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">PPC та дисплей.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fourth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"143\">Наші спеціальні кампанії створені для того, щоб стимулювати найважливіші дії.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fifth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Соц.медіа</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fifth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"144\">Збільшуємо охоплення бренду та залучаємо нових клієнтів у соціальних мережах.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sixth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-sixth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"107\">Розробляємо прямолінійну стратегію цифрового маркетингу.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-workouts_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-alwayson_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-altimeter_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-raidbow_txt#20\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-caption#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_title#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Now warming up</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-fitness_desc#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-link_fitness#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-text_fitness#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-description#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"404\">Неодноразово доведено, що наша суміш креативного, технічного та маркетингового маркетингу, а також одержимість забезпеченням якості збільшує дохід та частку ринку.\n&lt;br&gt;&lt;sup&gt;— Ми просто називаємо це &lt;b&gt;«Увага до digital ™»&lt;/b&gt;.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-custom_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#22-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#22-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:uk-blocks-subblocks#22-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><