 : ReStyle : : : .&amp;nbsp;&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageSmall#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":179}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageMedium#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":170}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageLarge#5\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":163}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-type#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-settings#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-title#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">UI Design</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-description#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"13\">&lt;p&gt;Crypto&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageSmall#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":178}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageMedium#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":175}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#9-sliderImageLarge#6\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":164}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_trigger#10\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_params#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_one#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"150\">&lt;b&gt;1. Discovery&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Requirements gathering: user personas, key use cases, current pain points, business goals, industry best practices.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_two#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"147\">&lt;b&gt;2. UI/UX audit&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Equity analysis, areas of opportunity, takeaway synthesis, WCAG 2.0 accessibility check, competitive analysis.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_three#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"128\">&lt;b&gt;3. Wireframes/Layout&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Information architecture, UX map, low-fidelity wireframes, draft clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_four#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"243\">&lt;b&gt;4. Visual concept and style application&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Visual direction, mood-boards, UI concept of the key screens. Applying a visual concept approved on the previous stage to the rest of the screens. High-fidelity clickable prototype.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_five#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"120\">&lt;b&gt;5. Motion and iconography&lt;/b&gt;&lt;br&gt; &lt;sup&gt;Motion studies of the interface behavior, iconography and illustrations.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-list_six#10\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"236\">&lt;b&gt;6. Assets and guides&lt;/b&gt;&lt;br&gt; &lt;sup&gt;A consistent library of UI elements (based on design system principles), recommendations for development team, iconography, illustrative guidelines and other brand identity element when needed.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#10\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#11\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-solo_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Post-production</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-solo_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"156\">Here\'s the real magic - a combination of key messages with brand images, videos and finishing touches that make your content stand out from the competition.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_title#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"25\">Lights, camera, action !.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-braided_desc#12\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"130\">We create all our content ourselves, while maintaining maximum control flexibility when it comes to all important post-processing.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#12\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#13\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_trigger#15\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-theme_params#15\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"1\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#15\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">colors</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">Productivity</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"28\">Perfectly balanced solutions</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"926\">Our range of effective marketing services focuses on growth, profitability and market share.\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Хмарні сервіси&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Відмовостійкі та масштабовані хмарні рішення, що надаються через (AWS; OVH; Google Cloud Platform).&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;\n&lt;div class=\"copy-block copy-block-custom-faces\"&gt;\n    &lt;h3 class=\"copy-block-headline typography-copy-block\"&gt;Оптимізація PageSpeed&lt;br&gt;&lt;/h3&gt;\n    &lt;p class=\"copy-block-copy typography-copy-block\"&gt;\n        &lt;sub&gt;Покращуємо взаємодію з користувачами, збільшуємо трафік та допомагаємо збільшити кількість конверсій.&lt;/sub&gt;&lt;br&gt;&lt;br&gt;\n    &lt;/p&gt;\n&lt;/div&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-finishes_caption#16\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"99\">Space Black Titanium,&lt;br class=\"small\"&gt; new Gold Stainless Steel,&lt;br class=\"small\"&gt; Silver Aluminum</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#16\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">motion</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"27\">Дизайн-послуги</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"51\">Виклик відчуттів та вражень</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"209\">Усі дизайнерські ідеї, які ми втілюєм ґрунтуються на кращому користувацькому досвіді з забезпеченням результату.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"59\">UX / Досвід взаємодії користувача</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"349\">Розробка інтерфейсного рішення, що залучає та зберігає клієнта, задовільнивши його потребу з найменшою кількістю часу і зусиль, з мінімальними помилками та почуттям емоційного задоволення.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"33\">Цифровий брендинг</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"271\">Розробка бренду з цифровим фокусом, відкриваючи ваші справжні бізнес-цінності для користувача та викликаючи розуміння, що він знайшов те, що шукав. </sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_title#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Графіка руху (анімація)</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_desc#17\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"340\">Створення ефектного та інформативного відеовмісту, банерів, анімаційних елементів, сторіс. Наші роботи привертають увагу, розважають і чудово справляються з поставленними завданнями. </sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#17\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">connected</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#18\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Розробка</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"125\">Реалізуєм&lt;br class=\"small\"&gt; ваші ідеї завдяки&lt;br class=\"small\"&gt; продуманим рішенням</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"228\">Застосовуючи креативність та амбіції, наша студія реалізовує ваші ідеї завдяки ретельно продуманим рішенням на замовлення.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"43\">Корпоративний веб-сайт.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"157\">Високопродуктивні рішення, створені для досягнення цілей та розвитку вашого бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Електронна комерція.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"167\">Повноцінний інтернет-магазин для продажу ваших товарів орієнтований на зростання бізнесу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Мульти-платформа.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"148\">Гнучка та мультифункціональна система, що ідеально підходить великим компаніям.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_title#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"30\">Нативні додатки.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_desc#18\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"175\">Якісні, технологічні мобільні додатки з високою продуктивністю та мультисистемною підтримкою.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"9\">connected</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#19\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Digital Marketing</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"35\">Цифровий маркетинг</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"322\">Ми пропонуємо стратегії цифрового маркетингу, які призводять до результатів. Працюючи на повному діапазоні цифрових каналів, ми залучатимемо вашу аудиторію, де б вона не була.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">SEO.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-first_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"178\">Чіткі, перевірені та зрозумілі стратегії SEO, що сприяють досягненню важливих для вас результатів.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Контент.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-second_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"142\">Станьте авторитетом у пошукових системах з тем, які цікавлять ваших клієнтів.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"32\">Електронна пошта.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-third_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"133\">Зверніть увагу на найбільш зацікавлену аудиторію, відповідно націливши.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">PPC та дисплей.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fourth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"143\">Наші спеціальні кампанії створені для того, щоб стимулювати найважливіші дії.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fifth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">Соц.медіа</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fifth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"144\">Збільшуємо охоплення бренду та залучаємо нових клієнтів у соціальних мережах.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sixth_title#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"18\">Стратегія</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-sixth_desc#19\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"107\">Розробляємо прямолінійну стратегію цифрового маркетингу.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">fitness</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Digital Branding</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"38\">Брендинг в Діджіталі</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"361\">Створюємо обличчя вашого бренду в діджіталі. Продумуємо комунікацію і створюємо динамічну айдентику, яка буде говорити про вас однаково всюди - в ваших презентаціях, рекламі, соцмережах і на сайті.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"53\">Quality Assurance / Тестування Якості</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-workouts_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"386\">Допоможемо знайти всі баги і недоліки в продукті перед його запуском. Складемо повний список завдань і варіанти їх рішень. Знаходимо уразливості, помилки, некоректну обробку запитів. Робимо ваш продукт чистіше.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"79\">Building IT infrastructure / Побудова ІТ інфраструктури</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-alwayson_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"444\">З нуля будуємо команду розробників для вашого проекту. Визначаємося з вашим стеком технологій і під нього вибудовуємо команду з якісних фахівців. Чи можемо зібрати і постійну команду, так і тимчасову, яка може знадобиться для запуску проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_title#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"72\">MVP concept and testing / Концепція і тестування MVP</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-altimeter_desc#20\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"518\">У короткі терміни запускаємо прості рішення, щоб перевірити гіпотези і теорії виведення вашого продукту на ринок. Запускаємо рекламну кампанію і тестовий продукт, аналізуємо відгуки, кліки та показники. На їх основі робимо висновки, які допоможуть при запуску повноцінного проекту.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-raidbow_txt#20\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"12\">fitness_plus</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-caption#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">Get 3 months of Apple Fitness+ free when you buy an Apple Watch.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fitness_title#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Now warming up</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-fitness_desc#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"199\">Introducing a new fitness experience powered by Apple Watch. With the world’s most welcoming and knowledgeable trainers. And workout metrics that are transported to your iPhone, iPad, and Apple TV.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-link_fitness#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">43f9f7e6-8896-4689-a62d-f4c03ef62458</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-text_fitness#21\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">Learn more about Apple Fitness+</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-type#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"5\">faces</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-settings#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"104\">{\"hidden\":true,\"segment_enabled\":null,\"segments\":null,\"target_groups_enabled\":null,\"target_groups\":null}</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"14\">Digital Studio</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subtitle#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Netexy</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-description#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"404\">Неодноразово доведено, що наша суміш креативного, технічного та маркетингового маркетингу, а також одержимість забезпеченням якості збільшує дохід та частку ринку.\n&lt;br&gt;&lt;sup&gt;— Ми просто називаємо це &lt;b&gt;«Увага до digital ™»&lt;/b&gt;.&lt;/sup&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_title#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"58\">Пристрасть до всього цифрового.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-custom_desc#22\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"250\">Від стратегії, пошукового маркетингу, до розробки дизайну, веб-сайтів, додатків, забезпечуємо клієнтів ефективними цифровими рішеннями.</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#22-length\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">6</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#22-type#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">data</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#22-settings#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"2\">[]</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#22-title#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">Title 1</sv:value></sv:property><sv:property sv:name=\"i18n:en-blocks-subblocks#22-description#0\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">&lt;p&gt;Description 1&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-bloc