ength=\"109\">Успішний продукт&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; з поглядом у майбутнє.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-body_tight\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"281\">Ми розробляємо продукти, які відрізняються неповторним і продуманим дизайном, який вирішує бізнес-завдання і виводить бренд на новий рівень сприйняття. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-caption_one\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"65\">Використовуємо найкращі практики UX</sv:value></sv:property><sv:property sv:name=\"i18n:uk-caption_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"54\">Створюємо цифрові можливості</sv:value></sv:property><sv:property sv:name=\"i18n:uk-caption_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"44\">Досягнення бізнес цілей</sv:value></sv:property><sv:property sv:name=\"i18n:uk-headline_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"123\">Створюємо можливості&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; впроваджуючи технології.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-body_tight_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"213\">Обожнюємо виходити за рамки креативу, дизайну і розробки. Так народжуються WOW-рішення, які запам\'ятовуються надовго. </sv:value></sv:property><sv:property sv:name=\"i18n:uk-img_caption_one\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Laptop</sv:value></sv:property><sv:property sv:name=\"i18n:uk-img_caption_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Tablet</sv:value></sv:property><sv:property sv:name=\"i18n:uk-img_caption_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Mobile</sv:value></sv:property><sv:property sv:name=\"i18n:uk-headline_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"49\">Дизайн &lt;br&gt;  для користувача.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-body_tight_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"389\">Ми думаємо про те, що хочуть робити користувачі та допомагаємо їм виконати ці завдання на максимально зручній та зрозумілій основі. Залучаємо весь досвід, щоб відповідати потребам та запитам різних користувачів.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-headline_four\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"87\">Більше&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; ніж сайт, чи додаток.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-body_tight_four\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"356\">Працюємо на випередження часу за допомогою інноваційних технологій. Створюємо рішення, \"обличчя\" бренду, інструмент продажів, іміджеву зброю. У цьому нам допомагає наш особливий підхід і досвід.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-text_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"34\">Обговорити  проект</sv:value></sv:property><sv:property sv:name=\"i18n:uk-icon_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">arrow_forward_ios</sv:value></sv:property><sv:property sv:name=\"i18n:uk-title_main\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"16\">Creative Designe</sv:value></sv:property><sv:property sv:name=\"i18n:uk-page_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">1f23315e-71bd-451c-8c8a-8c02c0018634</sv:value></sv:property><sv:property sv:name=\"i18n:en-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"15\">Creative Design</sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"0\"></sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-description\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"0\"></sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-keywords\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"0\"></sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-canonicalUrl\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"0\"></sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-noIndex\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-noFollow\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-seo-hideInSitemap\" sv:type=\"Boolean\" sv:multi-valued=\"0\"><sv:value length=\"0\">0</sv:value></sv:property><sv:property sv:name=\"i18n:en-excerpt-description\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"0\"></sv:value></sv:property><sv:property sv:name=\"i18n:en-excerpt-categories\" sv:type=\"String\" sv:multi-valued=\"1\"/><sv:property sv:name=\"i18n:en-excerpt-tags\" sv:type=\"String\" sv:multi-valued=\"1\"/><sv:property sv:name=\"i18n:en-excerpt-icon\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"ids\":[]}</sv:value></sv:property><sv:property sv:name=\"i18n:en-excerpt-images\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"ids\":[]}</sv:value></sv:property><sv:property sv:name=\"i18n:en-headline\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"84\">A successful product&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; with a view to the future.</sv:value></sv:property><sv:property sv:name=\"i18n:en-body_tight\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"140\">We develop products that have a unique and thoughtful design that solves business problems and takes the brand to a new level of perception.</sv:value></sv:property><sv:property sv:name=\"i18n:en-caption_one\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">We use UX best practices</sv:value></sv:property><sv:property sv:name=\"i18n:en-caption_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">We create digital opportunities</sv:value></sv:property><sv:property sv:name=\"i18n:en-caption_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">Achieving business goals</sv:value></sv:property><sv:property sv:name=\"i18n:en-headline_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"90\">We create opportunities&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; by implementing technologies.</sv:value></sv:property><sv:property sv:name=\"i18n:en-body_tight_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"130\">We love to go beyond creativity, design and development. This is how WOW-solutions are born, which are remembered for a long time.</sv:value></sv:property><sv:property sv:name=\"i18n:en-img_caption_one\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Laptop</sv:value></sv:property><sv:property sv:name=\"i18n:en-img_caption_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Tablet</sv:value></sv:property><sv:property sv:name=\"i18n:en-img_caption_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"6\">Mobile</sv:value></sv:property><sv:property sv:name=\"i18n:en-headline_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"24\">Design&lt;br&gt; for the user.</sv:value></sv:property><sv:property sv:name=\"i18n:en-body_tight_tree\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"204\">We think about what users want to do and help them complete these tasks in the most convenient and understandable way possible. We use all the experience to meet the needs and requests of different users.</sv:value></sv:property><sv:property sv:name=\"i18n:en-headline_four\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"64\">More than&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; a website or app.</sv:value></sv:property><sv:property sv:name=\"i18n:en-body_tight_four\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"193\">We work ahead of time with the help of innovative technologies. We create solutions, the \"face\" of the brand, a sales tool, an image weapon. Our special approach and experience help us in this.</sv:value></sv:property><sv:property sv:name=\"i18n:en-page_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">1f23315e-71bd-451c-8c8a-8c02c0018634</sv:value></sv:property><sv:property sv:name=\"i18n:en-text_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"19\">Discuss the project</sv:value></sv:property><sv:property sv:name=\"i18n:en-icon_link\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"17\">arrow_forward_ios</sv:value></sv:property><sv:property sv:name=\"i18n:en-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:en-published\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-07-15T05:17:25.120+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-creator\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-changer\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-created\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-07-15T05:17:24.912+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-changed\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-07-15T06:16:11.095+00:00</sv:value></sv:property></sv:node>\n', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<sv:node xmlns:mix=\"http://www.jcp.org/jcr/mix/1.0\" xmlns:nt=\"http://www.jcp.org/jcr/nt/1.0\" xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" xmlns:jcr=\"http://www.jcp.org/jcr/1.0\" xmlns:sv=\"http://www.jcp.org/jcr/sv/1.0\" xmlns:rep=\"internal\"><sv:property sv:name=\"i18n:uk-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">