(423, '/cmf/snippets/modal/development', '/cmf/snippets/modal', 'development', '', 'default', '367901f8-450e-4bbc-99fb-0f63e4a8ee13', 'nt:unstructured', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<sv:node xmlns:mix=\"http://www.jcp.org/jcr/mix/1.0\" xmlns:nt=\"http://www.jcp.org/jcr/nt/1.0\" xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" xmlns:jcr=\"http://www.jcp.org/jcr/1.0\" xmlns:sv=\"http://www.jcp.org/jcr/sv/1.0\" xmlns:rep=\"internal\"><sv:property sv:name=\"jcr:primaryType\" sv:type=\"Name\" sv:multi-valued=\"0\"><sv:value length=\"15\">nt:unstructured</sv:value></sv:property><sv:property sv:name=\"jcr:mixinTypes\" sv:type=\"Name\" sv:multi-valued=\"1\"><sv:value length=\"12\">sulu:snippet</sv:value></sv:property><sv:property sv:name=\"jcr:uuid\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"36\">367901f8-450e-4bbc-99fb-0f63e4a8ee13</sv:value></sv:property><sv:property sv:name=\"i18n:uk-title\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"11\">Development</sv:value></sv:property><sv:property sv:name=\"i18n:uk-headline\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"83\">A celebration of truth,&lt;br class=\"large\"&gt;&lt;br class=\"medium\"&gt; power, and solidarity.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-body_tight\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"313\">This collection features a watch band and face inspired by the colors of the Pan-African flag — red for the blood that unites people of the African Diaspora and was shed for their liberation, black for the Black people whose existence is affirmed by the flag, and green for the vibrant natural wealth of Africa.</sv:value></sv:property><sv:property sv:name=\"i18n:uk-caption_one\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"42\">Unity face that changes throughout the day</sv:value></sv:property><sv:property sv:name=\"i18n:uk-caption_two\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"39\">Blac