ur parked car, are created right on your device. Data used to improve navigation, such as routes and search terms, is not associated with your identity. Instead, that information is based on random identifiers that are constantly&amp;nbsp;changing.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:en-article_id\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">maps</sv:value></sv:property><sv:property sv:name=\"i18n:en-color_bg\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">#261901</sv:value></sv:property><sv:property sv:name=\"i18n:en-color_akcent\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">#ffa109</sv:value></sv:property><sv:property sv:name=\"i18n:en-color_modal\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">rgba(38, 24, 1, 0.9)</sv:value></sv:property><sv:property sv:name=\"i18n:en-videoLarge\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":103}</sv:value></sv:property><sv:property sv:name=\"i18n:en-videoMedium\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":104}</sv:value></sv:property><sv:property sv:name=\"i18n:en-videoSmall\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"10\">{\"id\":106}</sv:value></sv:property><sv:property sv:name=\"i18n:en-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">blog</sv:value></sv:property><sv:property sv:name=\"i18n:en-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:en-published\" sv:type=\"Date\" sv:multi-valued=\"0\"><sv:value length=\"29\">2021-07-15T05:19:44.887+00:00</sv:value></sv:property><sv:property sv:name=\"i18n:en-creator\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:en-changer\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv: