 so those memories don’t leave your hands until you share&amp;nbsp;them.&lt;/p&gt;&lt;p&gt;Some services process photos in the cloud, which gives them access to your photos. But we designed Photos to process your images right on your Mac, iPhone, and iPad. In fact, the Netexy Studio&amp;nbsp;Neural&amp;nbsp;Engine with the A13 and A14 Bionic chips performs over 100 billion operations per photo to recognize faces and places without ever leaving your&amp;nbsp;device. And when apps request access to your photos, you can share just the images you want — not your entire&amp;nbsp;library.&lt;/p&gt;</sv:value></sv:property><sv:property sv:name=\"i18n:uk-color_bg\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">#262107</sv:value></sv:property><sv:property sv:name=\"i18n:uk-color_akcent\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"7\">#ffda2f</sv:value></sv:property><sv:property sv:name=\"i18n:uk-color_modal\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"20\">rgba(38, 33, 8, 0.9)</sv:value></sv:property><sv:property sv:name=\"i18n:uk-videoLarge\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":120}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-videoMedium\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":122}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-videoSmall\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"31\">{\"displayOption\":null,\"id\":124}</sv:value></sv:property><sv:property sv:name=\"i18n:uk-template\" sv:type=\"String\" sv:multi-valued=\"0\"><sv:value length=\"4\">blog</sv:value></sv:property><sv:property sv:name=\"i18n:uk-state\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">2</sv:value></sv:property><sv:property sv:name=\"i18n:uk-creator\" sv:type=\"Long\" sv:multi-valued=\"0\"><sv:value length=\"1\">1</sv:value></sv:property><sv:property sv:name=\"i18n:uk-changer\" s